import { describe, expect, it } from 'vitest';
import { maxVowels } from '.';

describe('maxVowels', () => {
  it('maxVowels("abciiidef", 3) should be 3', () => {
    expect(maxVowels('abciiidef', 3)).toBe(3);
  });

  it('maxVowels("aeiou", 2) should be 2', () => {
    expect(maxVowels('aeiou', 2)).toBe(2);
  });

  it('maxVowels("leetcode", 3) should be 2', () => {
    expect(maxVowels('leetcode', 3)).toBe(2);
  });

  it('maxVowels("weallloveyou", 7) should be 4', () => {
    expect(maxVowels('weallloveyou', 7)).toBe(4);
  });

  it.skip('TLE test', () => {
    const s =
      '';

    expect(maxVowels(s, 50436)).toBe(9694);
  });
});
